	select f.torneo_id,f.fase_id,f.fecha_id into torneo,fase,fecha 
		from depor_partido as p 
		inner join depor_fecha as f on p.fecha_id=f.fecha_id 
		where p.partido_id=partidoid;		
	OPEN cur_1;
		REPEAT
		FETCH cur_1 INTO jugador;
			IF NOT done THEN		
				/*Elimino registros*/
				delete from depor_puntajefecha where fecha_id=fecha and jugador_id=jugador;
				/*Insertar registros*/
				set puntaje_f1 = fns_puntajejugador_fase(fecha,jugador,1);
				set puntaje_f2 = fns_puntajejugador_fase(fecha,jugador,2);
				set puntaje_f3 = fns_puntajejugador_fase(fecha,jugador,3);								
				set puntaje_juego    = puntaje_f1+puntaje_f2+puntaje_f3;
				IF puntaje_juego IS NULL THEN
					set puntaje_juego=0;
				END IF;
				set puntaje_total    = puntaje_juego+puntaje_pregunta+puntaje_acierto;
				values (fecha,fase,torneo,jugador,puntaje_juego,puntaje_pregunta,puntaje_acierto,puntaje_total);
			END IF;
		UNTIL done END REPEAT;
	CLOSE cur_1;
	/*Actualizo campo calculado*/
	update depor_partido set fecha_proceso=now(),calculado=1 where partido_id=partidoid;
	select 
		count(*) into cantidad
		from depor_fecha as f 
		inner join depor_partido as p on f.fecha_id=p.fecha_id
		where f.fecha_id=fecha
		and p.estado=1
		and p.calculado=1;
	select cantidad;
	IF cantidad=8 then
		update depor_fecha set fecha_proceso=now(),calculado=1 where fecha_id=fecha;			
	END IF;	
END//
DELIMITER ;


# Dumping structure for procedure profedepor2.ranking_grupo_fecha
DELIMITER //
CREATE DEFINER=`depor`@`%` PROCEDURE `ranking_grupo_fecha`(IN `fechaid` INT, IN `grupoid` INT, IN `liminf` INT, IN `limsup` INT)
BEGIN
	PREPARE statement FROM
	"SELECT pf.fecha_id, 
	jg.jugador_id, 
	pf.puntaje_juego, 
	pf.puntaje_total, 
	pf.registro, 	 
	jg.grupo_id,
	dj.nombres,
	dj.paterno,
	dj.nickname
	FROM depor_puntajefecha pf 
	INNER JOIN depor_jugadorgrupo jg 
		ON jg.jugador_id = pf.jugador_id
	INNER JOIN depor_jugador dj 
		ON dj.jugador_id = jg.jugador_id
	WHERE pf.fecha_id = ? 
		AND jg.grupo_id = ? 
		AND jg.flag_aprobado = 1
		AND jg.estado = 1
	ORDER BY pf.puntaje_total DESC
	LIMIT ?, ?";
	
	SET @p1 = fechaid;
	SET @p2 = grupoid;
	SET @p3 = liminf;
	SET @p4 = limsup;
	
	EXECUTE statement USING @p1, @p2, @p3, @p4;
    END//
DELIMITER ;


